    data: |
      SELECT DISTINCT - col0 / - + col2 + - col1 + + ( + col0 ) AS col0, + 53 / + + col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q296.out
    data: |
      -66	0
      74	2
      96	53
